import React from 'react';

import styles from './search_style.css';

export const PreviewCard = ({ strMeal, strTags, strCategory, strMealThumb }) => {
	return (
		<section>
			<img src={`${strMealThumb}/preview`} alt={strMeal} />
			<div className={styles.mealData}>
				<h4>{strMeal}</h4>
				<label htmlFor="tags">Tags: </label>
				{
					strTags === null ?
					<p name="tags">{strCategory}</p> :
					<p name="tags">{strTags}</p>
				}
			</div>
			<div className={styles.arrow}></div>
			<div className={styles.bgCard}></div>
		</section>
	);
}
